import React from "react";
import "./style.css";

function results(props){
    return(
        <div className="savedDiv">
            <h3 className="title">{props.title}</h3>
            <h4 className="subtitle">{props.subtitle}</h4>
            <h5 className="authors">{props.authors}</h5>
        </div>

    )
}

export default results;
